import React from 'react';
import '../App.css';
import {Text, Form, Button, Layout, BoxContainer, LinkList, Breadcrumb, Icon, InputGroup } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";

interface Props {
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const StyledContainer = styled(Layout.GridContainer)`
    grid-template-rows: 1fr;
    grid-template-columns: 12fr;
    grid-template-areas:
        "title"
        "button "
        "queue";
    grid-gap: 0.25rem;
    grid-row-gap: 15px;
    padding: 0 25px;
`;

const StyledSection = styled(Layout.Section)`
    margin-top: 8%;
    min-height: 600px;
`;

const Main = styled.main`
  color: white;
  grid-area: queue;
  padding: 0.25rem;
`;


const UpcomingAppointments: React.FunctionComponent<Props> = (props) => {
  return (
      <>
        <StyledSection>
        <Layout.Container>
            <Breadcrumb links={[ { title: 'Home' , url: '/' }, { title: 'Appointments', url: '/Appointments' }, { title: 'Upcoming Appointments', url: '/UpcomingAppointments' }  ]} />

            <StyledContainer>
                <Text.H3>Appointments</Text.H3>
                <Text.Body>Government services appointments</Text.Body>
                <div className='btn_right'>
                    <Button.Default
                        onClick={props.onSave}
                    >Next Number</Button.Default>
                </div>
                <Layout.GridContainer className="column2">
                <Text.H3>Appointments</Text.H3>
                <Text.Body>Government services appointments</Text.Body>

                <div className='btn_right'>
                    <Button.Default
                        onClick={props.onSave}
                    >Add</Button.Default>
                </div>
                </Layout.GridContainer>
            </StyledContainer>
            {/* <div className="spacer1"></div> */}
            <StyledContainer>
                <Main>
                    <LinkList items={[{
                    title: "Upcoming Appointments",
                    description: "There is currently one appointments.",
                    href: "/UpcomingAppointments",
                    target: "_blank"
                }, {
                    title: "Missed Appointments",
                    description: "There is no missed appointments.",
                    href: "https://www.google.com",
                    target: "_blank"
                }
                ]} style="small" maxShown={2} />
                </Main>
            </StyledContainer>
            <div className="spacer3"></div>
        </Layout.Container>
        </StyledSection>
    </>
  )
}

export default UpcomingAppointments;
